import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

// styled components for logo component
const Container = styled.div`
  position: absolute;
  top: 1rem;
  left: 1rem;

  width: 100%;
  color: ${(props) => props.theme.text};
  z-index: 5;
`;

const Logo = () => {
  return (
    <Container>
      <Link to="/">LOGO</Link>
    </Container>
  );
};

export default Logo;
